const reducer = (state = primerState, action)=>{
    if(action.type === "ADD_TITULAR"){
        return{
            ...state,
            titulares: state.titulares.concat(action.j),
            jugadores: state.jugadores.filter(x =>(x.id !== action.j.id))
        }
    }
    if (action.type === "ADD_SUPLENTE"){
        return {
            ...state,
            suplentes: state.suplentes.concat(action.j),
            jugadores: state.jugadores.filter(x => x.id !== action.j.id)
        }
    }
    if(action.type==="REMOVE_TITULAR"){
        return{
            ...state,
            titulares: state.titulares.filter(x=> x.id !== action.j.id),
            jugadores: state.jugadores.concat(action.j)
        }
    }
    if(action.type==="REMOVE_SUPLENTE"){
        return{
            ...state,
            suplentes: state.suplentes.filter(x=> x.id !== action.j.id),
            jugadores: state.jugadores.concat(action.j)
        }
    }else return state
        
}


export default createStore(reducer)